import logo from './logo.svg'
import './App.css'
import { Route, Routes, useNavigate, Navigate } from 'react-router-dom';

import MyPage from './Components/MyPage/MyPage'
import Footer from './Components/Footer/Footer'
import Header from './Components/Header/Header';
import NotFoundPage from './Components/NotFoundPage/NotFoundPage'
import Registration from './Components/Registration/Registration'
import MyFriendsPage from './Components/Friends/MyFriendsPage/MyFriendsPage'
import FriendsDreamsSlider from './Components/Friends/FriendsDreamsSlider/FriendsDreamsSlider'
import Login from './Components/Login/Login'
import FriendsSearching from './Components/Friends/ FriendsSearching/FriendsSearching'


function App() {
  return (
    <div className='App'>
      <Header/>
      <Routes>

        <Route
        exact path="/signup"
        element={
        <Registration/>
        }>
        </Route>

        <Route
        exact path="/signin"
        element={
        <Login/>
        }>
        </Route>

        <Route
        exact path="/page"
        element={
        <MyPage/>
        }>
        </Route> 

        <Route
        exact path="/my-friend-page"
        element={
        <MyFriendsPage/>
        }>
        </Route> 

        <Route
        exact path="/my-friends-full-dreams"
        element={
        <FriendsDreamsSlider/>
        }>
        </Route>

        <Route
        exact path="/friends-searching"
        element={
        <FriendsSearching/>
        }>
        </Route>

        <Route
        path="*"
        element={
        <NotFoundPage />
      }>
    </Route>
      </Routes>
    <Footer/>
    </div>
  );
}

export default App;
